import React from 'react'

export default function Category({category, showDescription}) {
    function showDescription() {
        showDescription(category.strCategoryDescription);
    }

    return (
        <div>
            <input type={"button"} value={category.strCategory} onClick={showDescription}></input>
        </div>
    )
}
